package com.csc440.beans;

public class ObservationTypeBean {
	private int id;
	private String name;
	private String obtype;

	public ObservationTypeBean() {
		// TODO Auto-generated constructor stub
	}

	public int getId() {
		return id;
	}

	public void setId(int id) {
		this.id = id;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	public String getObtype() {
		return obtype;
	}

	public void setObtype(String obtype) {
		this.obtype = obtype;
	}

}
